import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

class Welcome extends React.Component {
  render () {
    return <p>Hello!</p>
  }
}

const element = <Welcome />

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  element,
  <React.StrictMode>
    <App />
    <Welcome />
  </React.StrictMode>
);
